import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, } from "react-router-dom";
import './index.css';
import AppNav from "./AppNav";
import AppHeader from './AppHeader';
import AppMain from './AppMain';
import AppFooter from "./AppFooter";
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<AppNav/>, document.getElementById('nav'));
setInterval(function () {
    ReactDOM.render(<AppHeader/>, document.getElementById('header'));
},1);
ReactDOM.render(<AppMain/>, document.getElementById('main'));
ReactDOM.render(<AppFooter/>, document.getElementById('footer'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
